  `lg_name_local` varchar(99) DEFAULT '',
  `lg_sacred` tinyint(3) unsigned DEFAULT '0',
  `lg_constructed` tinyint(3) unsigned DEFAULT '0',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `uid` (`uid`),
  KEY `parent` (`pid`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=191 ;

